window.bookSummaryJSON = "<p><b>Lincoln</b></p> <p>I had my chance at love and I threw it away. I don't deserve another. I've dedicated my entire life to my community. There's no time for anything else.</p> <p>But then I met her. Ciara Jeffries is everything I told myself I didn't want but she might be everything I need. If I can just hold on to her.</p> <p><b>Ciara</b></p> <p>If I don't get out of this town I'll lose my sanity, my loved ones, and my life. I need a fresh start and Austin, Texas, feels like as good a place as any. I wasn't supposed to build connections and I definitely wasn't supposed to fall in love.</p> <p>Lincoln Cole has other plans for me. He has me breaking all my rules and I feel safe in his arms. But safety is a luxury I don't have. I thought I ran far enough but my past will never let me go and my recklessness may just get Lincoln burned.</p> <p>Contains mature themes.</p>"; 
